import './Header.scss';

const Benefits =()=>{
    return (
        <section className="hero-section pt-100 background-img">
            <div className="container">
                <div className="row align-items-center justify-content-between py-5">
                    <div className="col-md-7 col-lg-6">
                        <div className="hero-content-left text-white">
                            <h1 className="text-white"><span>Brainstorming</span> for desired perfect Usability</h1>
                            <p className="lead">
                                Our design projects are fresh and simple and will benefit your business greatly. Learn
                                more
                                about our work!
                                <a href="#download" className="btn app-store-btn">View Stats</a>
                            </p>
                        </div>
                    </div>
                </div>
            </div>
        </section>
    )
};

export default Benefits;
